import React, { Component } from 'react'

export class StreamItem extends Component {
  getThumbnail(url) {
    console.log(url)
  }

  render() {
    return (
      <div style={streamStyle}>
        <img src="{this.props.stream.thumbnail_url}" alt="" />
        {this.getThumbnail(this.props.stream.thumbnail_url)}
        <p>{this.props.stream.title}</p>
      </div>
    )
  }
}

const streamStyle = {
  backgroundColor: '#fff',
  padding: '10px',
  borderBottom: '1px #ccc solid',
}

export default StreamItem
